import React, { useState } from 'react';
import classes from './storePage_h.module.css';
import ProductIcon from '../../components/productIcon_c';

/**
 * Layout for the Store page
 */

const products = [
    {
        name: "red T-shirt",
        categories: ["shirt", "t-shirt", "clothing"],
        img_url: "t-shirt.jpeg"
    }, {
        name: "shirt",
        categories: ["shirt", "clothing"],
        img_url: "shirt.jpeg"
    }, {
        name: "plant",
        categories: ["plant"],
        img_url: "plant.jpeg"
    }];

const StorePage = () => {
    const [storeName, setStoreName] = useState("abc");

    return (
        <div>
            {storeName}

            <ProductIcon
                name="Rice Plantation"
                img_url="plant.jpeg"
                alt="plant"
                categories={["plant"]}
                onClick={() => console.log('clicked product...')}
                rating={4.5}
                price={420.69}
            />
        </div>
    );
};

export default StorePage;
